(234, 'swpm-settings', 'a:24:{i:0;b:0;s:29:\"email-activation-mail-subject\";s:40:\"Action Required to Activate Your Account\";s:26:\"email-activation-mail-body\";s:176:\"Dear {first_name}\n\nThank you for registering. To activate your account, please click on the following link (this will confirm your email address):\n\n{activation_link}\n\nThank You\";s:16:\"join-us-page-url\";s:58:\"http://localhost:8080/wordpress/index.php/membership-join/\";s:21:\"registration-page-url\";s:82:\"http://localhost:8080/wordpress/index.php/membership-join/membership-registration/\";s:14:\"login-page-url\";s:59:\"http://localhost:8080/wordpress/index.php/membership-login/\";s:16:\"profile-page-url\";s:78:\"http://localhost:8080/wordpress/index.php/membership-login/membership-profile/\";s:14:\"reset-page-url\";s:74:\"http://localhost:8080/wordpress/index.php/membership-login/password-reset/\";s:25:\"reg-complete-mail-subject\";s:29:\"Your registration is complete\";s:22:\"reg-complete-mail-body\";s:211:\"Dear {first_name} {last_name}\n\nYour registration is now complete!\n\nRegistration details:\nUsername: {user_name}\nPassword: {password}\n\nPlease login to the member area at the following URL:\n\n{login_link}\n\nThank You\";s:32:\"reg-prompt-complete-mail-subject\";s:26:\"Complete your registration\";s:29:\"reg-prompt-complete-mail-body\";s:146:\"Dear {first_name} {last_name}\n\nThank you for joining us!\n\nPlease complete your registration by visiting the following link:\n\n{reg_link}\n\nThank You\";s:29:\"upgrade-complete-mail-subject\";s:44:\"Subject for email sent after account upgrade\";s:26:\"upgrade-complete-mail-body\";s:73:\"Dear {first_name} {last_name}\n\nYour Account Has Been Upgraded.\n\nThank You\";s:18:\"reset-mail-subject\";s:30:\"My Worpress blog: New Password\";s:15:\"reset-mail-body\";s:213:\"Dear {first_name} {last_name}\n\nHere is your new password:\n\nUsername: {user_name}\nPassword: {password}\n\nYou can change the password from the edit profile section of the site (after you log into the site)\n\nThank You\";s:28:\"account-change-email-subject\";s:16:\"Account Updated!\";s:25:\"account-change-email-body\";s:149:\"Dear {first_name} {last_name},\n\nYour account status has been updated! Please login to the member area at the following URL:\n\n {login_link}\n\nThank You\";s:10:\"email-from\";s:34:\"My Worpress blog <hello@localhost>\";s:31:\"reg-complete-mail-subject-admin\";s:39:\"Notification of New Member Registration\";s:28:\"reg-complete-mail-body-admin\";s:242:\"A new member has completed the registration.\n\nUsername: {user_name}\nEmail: {email}\n\nPlease login to the admin dashboard to view details of this user.\n\nYou can customize this email message from the Email Settings menu of the plugin.\n\nThank You\";s:33:\"bulk-activate-notify-mail-subject\";s:18:\"Account Activated!\";s:30:\"bulk-activate-notify-mail-body\";s:87:\"Hi,\n\nYour account has been activated!\n\nYou can now login to the member area.\n\nThank You\";s:19:\"swpm-active-version\";s:5:\"3.9.9\";}', 'yes'),
